import './Main.css';
function Upsc_2() {
  return (
  <>
  <h2 class="text-center p-5"><b>UPSC</b> PATHSHALA</h2>
  <div class="container" className="upsc2">
	<h1>Thank you for taking first step towards UPSC Preparation!</h1>
  <div class="row">
	<div class="col-sm-4">
		<h2>IMAGE</h2>
	</div>
	<div class="col-sm-6">
		<p><b>What's Next?</b></p>
		<p>You will get a call within 12 hours</p>
		<p>Don't miss this call.Ask for the Free Demo</p>
		<p>Attend the demo and experience our teaching methods</p>
		<p>Ask , if you are eligible for any scholarship or discounts</p>

	</div>
  </div>
  </div>

  </>
  );
}

export default Upsc_2;
